import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Service from './screen/Service';
import Main from './screen/Main';
import Signin from './screen/Signin';
import Login from './screen/Login';
import Select from './screen/Select';
import Signin2 from './screen/Signin2';
import Footer from "./screen/Footer";
import { useState } from "react";

function App() {
  const [login, setLogin] = useState("");
  const [id, setId] = useState("");
  const [age, setAge] = useState("");
  const [gender, setGender] = useState("");
  const [link, setLink] = useState("");
  const [mbti, setMbti] = useState("");
  const [addr, setAddr] = useState("");
  const [keyword, setKeyword] = useState("");
  const [idealage, setIdealage] = useState("");
  const [idealmbti, setidealMbti] = useState("");
  const [idealaddr, setidealAddr] = useState("");
  const [idealkeyword, setIdealkeyword] = useState("");

  function getLogin(id) {
    setLogin(id);      
  }

  function getData(id, age, gender, link="", mbti, addr, keyword, ideal_age, ideal_mbti, ideal_addr, ideal_keyword) {
    setId(id);
    setAge(age);

  }

  let user = {
    id : id,
    age : age,
    gender : gender,
    link : link,
    mbti : mbti,
    addr : addr,
    keyword : keyword,
    ideal_age : idealage,
    ideal_mbti : idealmbti,
    ideal_addr : idealaddr,
    ideal_keyword : idealk
  }

  return (
    <div className="App">
      <Footer></Footer>
      
      <Router>
        <Routes>
          <Route path="/" element={<Main />}></Route>
          <Route path="/service" element={<Service />}></Route>
          <Route path="/signin" element={<Signin />}></Route>
          <Route path="/signin2" element={<Signin2 />}></Route>
          <Route path="/login" element={<Login getLogin={getLogin}/>}></Route>
          <Route path="/select" element={<Select login={login}/>}></Route>
          
          <Route path="*" element={<div>404</div>}></Route>
        </Routes>
      </Router>
    </div>
    );
}

export default App;
